In late September (when traveling was still possible) @_lutz_i and I set out on a journey to northern Italy. Our mission: experiencing South Tyrol’s beauty and diversity with our freshly converted van @gilbertroams. Instead of planning in advance we decided to let our curiosity take the lead. The result: A wild mix of locations, activities and weather conditions - a bucket full of memories and a dream I’ll return to as soon as we can.
I tried to capture the vibe so that you could experience it, too. Let me know if it works! 🙏🏻
